import UIKit

class Solution {
    func lengthOfLongestSubstring(_ s: String) -> Int {
        var charDic = [Character:Int]()
        var chars = Array(s)
        var i = 0 , ans = 0
        for  j in  0..<s.count {
            if let index = charDic[chars[j]]{
              print(charDic[chars[j]])
                i = max(index, i)
            }
          
            ans = max(ans, j-i+1)
            charDic[chars[j]] = j+1
          print(ans)
          print(charDic)
        }
        return  ans
    }
}

